import '../../App.css';
import Header from '../utils/Header';

function LandingPage() {
  return (
    <div style={{ width: '100%' }}>
      <Header />
      <div style={{ width: '100%' }}>
        <div>
          <h2>Des solutions personnalisées pour alléger vos mensualités</h2>
        </div>
        <img style={{ width: '50%', height: 'auto' }} alt="simplifiez vos finances" src={require('../../pictures/landingPagePeople.png')} />
      </div>
    </div>
  );
}

export default LandingPage;
